	add("bean", "{\"term\":\"bean\", \"etymology\":{\"influencers\":[{},{},{},{},{}], \"languages\":[\"old english (ca. 450-1100)\", \"Danish\", \"German\", \"English\", \"middle english (1100-1500)\", \"West Frisian\", \"Icelandic\", \"Latin\", \"Dutch\", \"Russian\", \"scots\"], \"text\":\"From Middle english (1100-1500) \u0027bene\u0027 from Old english (ca. 450-1100) {{m|ang|bēan||bean, pea, legume}}, from Proto-germanic {{m|gem-pro|*baunō||bean}}, from Proto-indo-european {{m|ine-pro|*bʰabʰ-||bean}}. Cognate with Scots \u0027bene\u0027 \u0027bein\u0027 (bean) West frisian \u0027bean\u0027 (bean) Dutch \u0027boon\u0027 (bean) German \u0027bohne\u0027 (bean) Danish \u0027bønne\u0027 (bean) Icelandic \u0027baun\u0027 (bean) Latin \u0027faba\u0027 (bean) Russian \u0027боб\u0027 (bean)\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"Any plant of several genera of the taxonomic family \u0027Fabaceae\u0027 that produces large edible seeds or edible seed pods\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"2004\u0027\u0027, T. N. Shivenanda, B. R. V. Iyengar, \u0027Phosphorus Management in French Bean (Phaseolus Vulgaris L.)\u0027, Ramdane Dris, S. Mohan Jain (editors), \u0027Production Practices and Quality Assessment of Food Crops\u0027, Volume 2: Plant Mineral Nutrition and Pesticide Management, [http://books.google.com.au/books?id\u003dFqNjMDCO3ywC\u0026amp;pg\u003dPA79\u0026amp;dq\u003d%22bean%22%7C%22beans%22\u0026amp;hl\u003den\u0026amp;sa\u003dX\u0026amp;ei\u003dEPQlUu6NNsnBkwW1mYDoCw\u0026amp;redir_esc\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"v\u003donepage\u0026amp;q\u003d%22bean%22%7C%22beans%22\u0026amp;f\u003dfalse page 79\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"Beans\u0027\u0027 are a large group of leguminous vegetables that serve as a main source of proteins in human diet. This group comprises several species and some of them are Adzuki \u0027\u0027bean\u0027\u0027 (\u0027Vigna angularis\u0027); Broad \u0027\u0027bean\u0027\u0027 (\u0027Vicia faba\u0027); Cluster \u0027\u0027bean\u0027\u0027 (\u0027Cyamposis tetragonoloba\u0027); French \u0027\u0027bean\u0027\u0027 (\u0027Phaseolus vulgaris\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"The large edible seed of such a plant\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"The edible seed pod of such a plant\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"The bean-like seed of certain other plants, especially coffee; coffee in the general\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"An object resembling a pea or bean in shape, often made from plastic or styrofoam and used in large numbers as packing material or as stuffing for beanbags and similar items\", \"priority\":8},{\"upperType\":\"NOUN\", \"text\":\"The head or brain\", \"priority\":9},{\"upperType\":\"NOUN\", \"text\":\"section\u003dchapter XI and passage\u003dI saw her quiver and kept a wary eye on the ginger ale bottle. But even if she had raised it and brought it down on [my\u0026lt;!--orig. \u0026quot;the Wooster\u0026quot; said by Wooster about himself--\u0026gt;] \u0027\u0027bean\u0027\u0027, I couldn\u0027t have been more stunned than I was by the words that left her lips. \u0026lt;br\u0026gt;[...]\u0026lt;br\u0026gt;\u0026lt;!--ch. XV--\u0026gt; Well, as I say, it was from his fertile \u0027\u0027bean\u0027\u0027 that the idea sprang\", \"priority\":10},{\"upperType\":\"NOUN\", \"text\":\"A guinea coin\", \"priority\":11},{\"upperType\":\"NOUN\", \"text\":\"Money\", \"priority\":12},{\"upperType\":\"NOUN\", \"text\":\"I haven\u0027t got a \u0027\u0027bean\", \"priority\":13},{\"upperType\":\"NOUN\", \"text\":\"The clitoris\", \"priority\":14},{\"upperType\":\"NOUN\", \"text\":\"2010\u0027\u0027, Cynthia W. Gentry \u0026amp; Dana Fredst, \u0027What Women Really Want in Bed: The Surprising Secrets Women Wish Men Knew about Sex\u0027, Quiver (2010), ISBN 9781592333394, [http://books.google.com/books?id\u003dw7FpuhzXnW4C\u0026amp;pg\u003dPA64 page 64\", \"priority\":15},{\"upperType\":\"NOUN\", \"text\":\"For one, don\u0027t stage a full-frontal assault on her \u0027\u0027bean\", \"priority\":16},{\"upperType\":\"NOUN\", \"text\":\"„\u0026lt;code\u0026gt;AppletInitializer\u0026lt;/code\u0026gt; Methods in this interface are used to initialize Beans that are also applets\", \"priority\":17},{\"upperType\":\"NOUN\", \"text\":\"„The \u0026lt;code\u0026gt;SelectionInList\u0026lt;/code\u0026gt; uses three \u0026lt;code\u0026gt;ValueModel\u0026lt;/code\u0026gt;s to hold the list, the selection and selection index and provides bound bean properties for these models. You can access, observe and replace these \u0026lt;code\u0026gt;ValueModel\u0026lt;/code\u0026gt;s. This is useful to connect a \u0026lt;code\u0026gt;SelectionInList\u0026lt;/code\u0026gt; with other \u0026lt;code\u0026gt;ValueModel\u0026lt;/code\u0026gt;s; for example you can use the \u0026lt;code\u0026gt;SelectionInList\u0026lt;/code\u0026gt;\u0027s selection holder as bean channel for a \u0026lt;code\u0026gt;PresentationModel\u0026lt;/code\u0026gt;. Since the \u0026lt;code\u0026gt;SelectionInList\u0026lt;/code\u0026gt; is a \u0026lt;code\u0026gt;ValueModel\u0026lt;/code\u0026gt;, it is often used as bean channel. See the Binding tutorial classes for examples on how to connect a \u0026lt;code\u0026gt;SelectionInList\u0026lt;/code\u0026gt; with a \u0026lt;code\u0026gt;PresentationModel\u0026lt;/code\u0026gt;.“\", \"priority\":18}]}, \"synonyms\":{}}");

	add("beau", "{\"term\":\"beau\", \"etymology\":{\"influencers\":[{}], \"languages\":[\"English\", \"Latin\"], \"text\":\"{{borrowing|fr|beau|lang\u003den}} \u0026lt; Latin \u0027bellus\u0027 (beautiful)\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A man with a reputation for fine dress and etiquette; a dandy or fop\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"1811\u0027\u0027, Jane Austen, \u0027Sense and Sensibility\u0027, chapter 2\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"“\u0026lt;!--...--\u0026gt;I do not comprehend the meaning of the word. But this I can say, that if he ever was a \u0027\u0027beau\u0027\u0027 before he married, he is one still, for there is not the smallest alteration in him\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"“Oh! dear! one never thinks of married mens’ being \u0027\u0027beaux\u0027\u0027—they have something else to do\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"A male lover; a boyfriend\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"1917\u0027\u0027, Kate Douglas Wiggin, \u0027Rebecca of Sunnybrook Farm\u0027, p. 142\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"Hannah\u0027s \u0027\u0027beau\u0027\u0027 takes all her time \u0027n\u0027 thought, and when she gits a husband her mother\u0027ll be out o\u0027 sight and out o\u0027 mind\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"2009\u0027\u0027, Philippa Bourke, \u0027Monsters and Critics\u0027 [http://www.monstersandcritics.com/people/news/article_1518335.php/Kristin-Davis-takes-cover-on-beach-with-bea\", \"priority\":8},{\"upperType\":\"NOUN\", \"text\":\"ixzz0ZRsqa5SS], Dec 10, 2009\", \"priority\":9},{\"upperType\":\"NOUN\", \"text\":\"Kristin Davis has taken time out to enjoy the surf and sand with her Australian \u0027\u0027beau\u0027\u0027, photographer Russell James\", \"priority\":10},{\"upperType\":\"NOUN\", \"text\":\"A male escort\", \"priority\":11}]}, \"synonyms\":{}}");

