	add("beadle", "{\"term\":\"beadle\", \"etymology\":{\"influencers\":[{}], \"languages\":[\"old english (ca. 450-1100)\", \"German\", \"English\", \"middle english (1100-1500)\", \"old high german (ca. 750-1050)\"], \"text\":\"From Middle english (1100-1500) \u0027bedel\u0027 from Old english (ca. 450-1100) \u0027bydel\u0027 (warrant officer, apparitor) from Proto-germanic {{m|gem-pro|*budilaz||herald}}, from Proto-germanic {{m|gem-pro|*beudaną||to present, offer}}, from Proto-indo-european {{m|ine-pro|*bʰewdʰ-||to comprehend, make aware}}. Akin to Old high german (ca. 750-1050) \u0027butil\u0027 (beadle) (whence German \u0027büttel\u0027 , Old english (ca. 450-1100) {{m|ang|bēodan||to announce}}. More at {{l/en|bid}}.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"a parish constable, a uniformed minor (lay) official, who ushers and keeps orde\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"an attendant to the ministe\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"a warrant officer\", \"priority\":3}]}, \"synonyms\":{}}");

	add("beagle", "{\"term\":\"beagle\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"middle english (1100-1500)\", \"middle french (ca. 1400-1600)\"], \"text\":\"From Middle english (1100-1500) \u0027begle\u0027 Origin uncertain, possibly from Middle french (ca. 1400-1600) \u0027beegueule\u0027 from \u0027beer\u0027 (variation of \u0027bayer\u0027 + \u0027gueule\u0027 The French \u0027bigle\u0027 is from the English.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A small short-legged smooth-coated hound, often used for hunting hares. Often tri-coloured, its friendly disposition makes it suitable as a family pet\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"A person who snoops on others; a detective\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"2002\u0027\u0027, Susan Isaacs, \u0027Long Time No See\u0027, page 24\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"whereas burying a body in the wooded area beyond the backyard was the quickest way to make a Nassau County Police Department \u0027\u0027beagle\u0027\u0027 look good\", \"priority\":4}]}, \"synonyms\":{}}");

	add("beaglepuss", "{\"term\":\"beaglepuss\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"From Franco-American Novelty Company\u0027s brand name \u0026quot;Beagle Puss Disguise Kit\u0026quot;, apparently from {{compound|beagle|puss|gloss2\u003dface|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A novelty pair of horn-rimmed glasses with attached eyebrows, plastic nose, and bushy mustache, caricaturing w:Groucho Groucho Marx\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"page \u003d 60 url \u003d http://books.google.com/books?ei\u003dpk3DTv6PHcejtgeeuLi6DQ passage \u003d Vonnegut did not write the book, and the photo on the book jacket of Trout looked suspiciously like Farmer, wearing Boss Mule work gloves, \u0027\u0027beagle puss\u0027\u0027 and mustache, sunglasses, mufflers, etc\", \"priority\":2}]}, \"synonyms\":{}}");

	add("beaker", "{\"term\":\"beaker\", \"etymology\":{\"influencers\":[{},{}], \"languages\":[\"Danish\", \"German\", \"English\", \"middle english (1100-1500)\", \"ancient greek (to 1453)\", \"Latin\", \"Dutch\", \"old norse\", \"old saxon\"], \"text\":\"From Middle english (1100-1500) \u0027biker\u0027 from Old norse \u0027bikarr\u0027 (cup) from Old saxon \u0027bikeri\u0027 (cup) from {{m|la|bīcārium||wine vat, jug}}, of disputed origin. Possibly from Ancient greek (to 1453) \u0027βίκος\u0027 (earthenware jug, wine jar) or from Latin \u0027bacarium\u0027 (wine vat, vase) Cognate with Dutch \u0027beker\u0027 (beaker, cup) German \u0027becher\u0027 (beaker, cup, goblet) Danish \u0027bæger\u0027 (beaker) Italian \u0027bicchiere\u0027 (cup, glass (for drink)) See also {{l/en|pitcher}}.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A flat-bottomed vessel, with a lip, used as a laboratory container\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"A drinking vessel without a handle, sometimes for the use of children\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"A mug\", \"priority\":3}]}, \"synonyms\":{}}");

