	add("beamstrahlung", "{\"term\":\"beamstrahlung\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"From \u0027\u0027 + \u0027\u0027\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The radiation from one beam of charged particles in a storage ring or linear collider caused by its interaction with the electromagnetic field of the other beam. Coined by J. Rees in 1978. \u0026lt;ref\u0026gt;\u0026quot;Limitations on Performance of e+ e- Storage Rings andLinear Colliding Beam Systems at High Energy,\u0026quot; http://www.slac.stanford.edu/econf/C781015/pdf/009.pdf\u0026lt;/ref\u0026gt\", \"priority\":1}]}, \"synonyms\":{}}");

