	add("beano", "{\"term\":\"beano\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"Abbreviation of \u0027\u0027\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A beanfeast; any noisy celebration, a party\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"1912\u0027\u0027, \u0026quot;The Woman at the Store\u0026quot;, \u0027Selected Short Stories\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"You gas like a kid at a Sunday School \u0027\u0027beano\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"1978\u0027\u0027, \u0027Livia\u0027, Faber \u0026amp; Faber 1992 (\u0027Avignon Quintet\u0027), p. 419\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"‘Every year,’ said Lord Galen happily, ‘I have this little \u0027\u0027beano\u0027\u0027 as a farewell treat before leaving France\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"Any home-made gas or indigestion remedy\", \"priority\":6}]}, \"synonyms\":{}}");

