	add("beard", "{\"term\":\"beard\", \"etymology\":{\"influencers\":[], \"languages\":[\"old english (ca. 450-1100)\", \"German\", \"English\", \"middle english (1100-1500)\", \"West Frisian\", \"Latin\", \"Lithuanian\", \"Dutch\", \"Russian\"], \"text\":\"From Middle english (1100-1500) {{m|enm|berd}}, from Old english (ca. 450-1100) {{m|ang|beard}}, from Proto-germanic {{m|gem-pro|*bardaz}} (compare West frisian {{m|fy|burd}}, Dutch {{m|nl|baard}}, German {{m|de|Bart}}), from Proto-indo-european {{m|ine-pro|*bʰardʰeh₂|*bʰardʰ-eh₂}} (compare Latin {{m|la|barba}}, Lithuanian {{m|lt|barzda}}, Russian {{m|ru|борода́}}).\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"Facial hair on the chin, cheeks and jaw\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"The cluster of small feathers at the base of the beak in some birds\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"The appendages to the jaw in some cetaceans, and to the mouth or jaws of some fishes\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"The byssus of certain shellfish\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"The gills of some bivalves, such as the oyster\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"In insects, the hairs of the labial palpi of moths and butterflies\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"Long or stiff hairs on a plant; the awn\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"the \u0027\u0027beard\u0027\u0027 of grain\", \"priority\":8},{\"upperType\":\"NOUN\", \"text\":\"A barb or sharp point of an arrow or other instrument, projecting backward to prevent the head from being easily drawn out\", \"priority\":9},{\"upperType\":\"NOUN\", \"text\":\"That part of the underside of a horse\u0027s lower jaw which is above the chin, and bears the curb of a bridle\", \"priority\":10},{\"upperType\":\"NOUN\", \"text\":\"That part of a type which is between the shoulder of the shank and the face\", \"priority\":11},{\"upperType\":\"NOUN\", \"text\":\"A woman who accompanies a gay male in order to give the impression that he is heterosexual\", \"priority\":12}]}, \"synonyms\":{}}");

	add("bearberry", "{\"term\":\"bearberry\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{compound|bear|berry|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"Any of three dwarf shrubs of the genus \u0027Arctostaphylos\u0027, which principally grow in arctic and subarctic regions and bear edible berries\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"1952\u0027\u0027, Farley Mowat, \u0027People of the Deer\u0027, Key Porter 2005, p. 26\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"Sometimes she scrabbled through the drifts on hilltops and found a few wizened \u0027\u0027bearberries\u0027\u0027 or a handful of rock-tripe, a kind of moss\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"Arctostaphylos uva-ursi\u0027, the\", \"priority\":4}]}, \"synonyms\":{}}");

