	add("beast", "{\"term\":\"beast\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"middle english (1100-1500)\", \"French\", \"old french (842-ca. 1400)\", \"Latin\"], \"text\":\"From Middle english (1100-1500) {{m|enm|beeste}}, {{m|enm|beste}}, from Old french (842-ca. 1400) {{m|fro|beste}} (French {{m|fr|bête}}), from Latin {{m|la|bēstia||animal, beast}}; many cognates – see \u0027bēstia\u0027\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"Any animal other than a human; usually only applied to land vertebrates, especially large or dangerous four-footed ones\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"more specific)\u0026amp;nbsp; A domestic animal, especially a bovine farm animal\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"Boxer was an enormous \u0027\u0027beast\u0027\u0027, nearly eighteen hands high, and as strong as any two ordinary horses put together\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"chapter\u003d7|url\u003dhttp://openlibrary.org/works/OL2004261W|passage\u003d‘Children crawled over each other like little grey worms in the gutters,’ he said. ‘The only red things about them were their buttocks and they were raw. Their faces looked as if snails had slimed on them and their mothers were like great sick \u0027\u0027beasts\u0027\u0027 whose byres had never been cleared.\u0026amp;nbsp;[…]’\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"A person who behaves in a violent, antisocial or uncivilized manner\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"A large and impressive thing or structure\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"Someone who is particularly impressive, especially athletically or physically\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"A sex offender\", \"priority\":8},{\"upperType\":\"NOUN\", \"text\":\"1994\u0027\u0027, Elaine Player, Michael Jenkins, \u0027Prisons After Woolf: Reform Through Riot\u0027 (page 190\", \"priority\":9},{\"upperType\":\"NOUN\", \"text\":\"Shouts had been heard: \u0027We\u0027re coming to kill you, \u0027\u0027beasts\u0027\u0027.\u0027 In desperation, Rule 43s had tried to barricade their door\", \"priority\":10},{\"upperType\":\"NOUN\", \"text\":\"1994\u0027\u0027, Adam Sampson, \u0027Acts of Abuse: Sex Offenders And the Criminal Justice System\u0027 (page 83\", \"priority\":11},{\"upperType\":\"NOUN\", \"text\":\"For many prisoners and in many prisons, antipathy towards \u0027nonces\u0027 or \u0027\u0027beasts\u0027\u0027 is little more than an ide\", \"priority\":12},{\"upperType\":\"NOUN\", \"text\":\"Something unpleasant and difficult\", \"priority\":13},{\"upperType\":\"NOUN\", \"text\":\"2000\u0027\u0027, Tom Clancy, \u0027The Bear and the Dragon\u0027, Berkley (2001), ISBN 9780425180969, [http://books.google.com/books?id\u003dB0oJPv_XEjIC\u0026amp;pg\u003dPA905\u0026amp;dq\u003d%22beast+of+a+problem%2\", \"priority\":14},{\"upperType\":\"NOUN\", \"text\":\"v\u003donepage\u0026amp;q\u003d%22beast%20of%20a%20problem%22\u0026amp;f\u003dfalse page 905\", \"priority\":15},{\"upperType\":\"NOUN\", \"text\":\"Even unopposed, the natural obstacles are formidable, and defending his line of advance will be a \u0027\u0027beast\u0027\u0027 of a problem.\u0026quot\", \"priority\":16},{\"upperType\":\"NOUN\", \"text\":\"2006\u0027\u0027, Heather Burt, \u0027Adam\u0027s Peak\u0027, Dundurn Press (2006), ISBN 9781550026467, [http://books.google.com/books?id\u003dXatBBWaECJ0C\u0026amp;pg\u003dPA114\u0026amp;dq\u003d%22beast+of+a+headache%22 page 114\", \"priority\":17},{\"upperType\":\"NOUN\", \"text\":\"He\u0027d be in the hospital a few days — broken collarbone, a cast on his arm, a \u0027\u0027beast\u0027\u0027 of a headache — but fine\", \"priority\":18},{\"upperType\":\"NOUN\", \"text\":\"2011\u0027\u0027, w:Florence and the Florence + the Machine, \u0026quot;w:What the Water Gave What the Water Gave Me\u0026quot;, Ceremonials\", \"priority\":19},{\"upperType\":\"NOUN\", \"text\":\"And, oh, poor Atlas / The world\u0027s a \u0027\u0027beast\u0027\u0027 of a burden / You\u0027ve been holding up a long time\", \"priority\":20}]}, \"synonyms\":{}}");

