	add("beatification", "{\"term\":\"beatification\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"middle french (ca. 1400-1600)\"], \"text\":\"From Middle french (ca. 1400-1600) \u0027béatification\u0027 from \u0027beatificatio\u0027\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The act of beatifying, or the state of being beatified; especially, in the Roman Catholic Church, the act or process of ascertaining and declaring that a deceased person is one of \u0026quot;the blessed,\u0026quot; or has attained the second degree of sanctity, \u0026amp;mdash; usually a stage in the process of canonization\", \"priority\":1}]}, \"synonyms\":{}}");

