	add("beatles", "{\"term\":\"beatles\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"* A combination of the words \u0027beetles\u0027\u0026amp;mdash;as a sign of respect to w:The Crickets|The Crickets\u0026amp;mdash;and \u0027beat\u0027, as in \u0027beat music\u0027 or the \u0027beat\u0027 of a drum.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"An extremely successful and influential British rock music quartet that operated primarily in the 1960s\", \"priority\":1}]}, \"synonyms\":{}}");

