	add("beatnik", "{\"term\":\"beatnik\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"Russian\"], \"text\":\"Coined by San Francisco columnist w:Herb Caen|Herb Caen in 1958.\u0026lt;ref\u0026gt;{{cite news|first\u003dHerb|last\u003dCaen|authorlink\u003dHerb Cain|newspaper\u003d{{w|San Francisco Chronicle}}|url\u003dhttp://www.sfgate.com/cgi-bin/article.cgi?f\u003d/c/a/1997/02/06/MN18715.DTL|issn\u003d1932-8672|title\u003dWords, Words, Words|date\u003d1958-04-02}}\u0026lt;/ref\u0026gt; From \u0027beat\u0027 (generation) + cutesy or ironic use of the Russian suffix \u0027-ник\u0027 () This suffix experienced a surge in English coinages for nicknames and diminutives after the 1957 Soviet launch of the w:Sputnik program|Sputnik satellite. Compare \u0027jazznik\u0027\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A person who dresses in a manner that is not socially acceptable and whose manner of dress reflects a rejection of conventional norms of thought and behavior; nonconformist in dress and behavio\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"A person associated with the Beat Generation of the 1950s and 1960s or its style\", \"priority\":2}]}, \"synonyms\":{}}");

	add("beatnikism", "{\"term\":\"beatnikism\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{suffix|beatnik|ism|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The social and artistic ideas associated with beatnik\", \"priority\":1}]}, \"synonyms\":{}}");

