	add("beautification", "{\"term\":\"beautification\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"Attested since at least 1790, from {{suffix|beautify|gloss1\u003dto make beautiful|ification|lang\u003den}}.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"Making beautiful, beautifying, improving the appearance of something\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"Thanks to the beautification efforts, the highway\u0027s looks have vastly improved\", \"priority\":2}]}, \"synonyms\":{}}");

